onPress={() => navigation.navigate(

'petview',

{

details: ['https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSeD78SmfIzEvQR_ZXxhiAZ_ng-DdTFMYagKQ&usqp=CAU',

