}}

/>

</View>

</TouchableOpacity>

<TouchableOpacity

onPress={() => navigation.navigate(

'petview',

{ details: ['https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTIYzuY_krlxpx_BXJ7SgRDHQOyjrHEcuZcSA&usqp=CAU',

